import React from "react";

const CustomerList = () => {
  return (
    <>
      <h1>all customers</h1>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>email</th>
            <th>phone</th>
            <th>location</th>
            <th>sub pack</th>
            <th>action</th>
          </tr>
        </thead>
      </table>
    </>
  );
};

export default CustomerList;
